import React from 'react'
import './Filter.css'


function Filter(props) {
    function handle(){
        let ele = document.getElementById(props.name);
        if(ele.checked){
            console.log(props.name);
        }
    }
    if(props.type === "text"){
        return (
            <div className = "Filter">
                <label for={props.name}>{props.name}</label>
                <input type={props.type} value={props.name} id={props.name} onChange={handle}></input>
            </div>
        )
    }else{
        return (
            <div className = "Filter">
                <input type={props.type} value={props.name} id={props.name} onChange={handle}></input>
                <label for={props.name}>{props.name}</label>            
            </div>
        )
    }
}
export default Filter;
